const staticAssets=["./index.html","./assets/favicon.ico","./css/index.css","./js/index.bundle.js","./js/single.bundle.js","./js/modules.bundle.js"];async function cacheFirst(s){return caches.match(s)||fetch(s)}async function networkFirst(s){const t=await caches.open("dynamic-cache");try{const e=await fetch(s);return t.put(s,e.clone()),e}catch(e){return await t.match(s)}}self.addEventListener("install",(async()=>{(await caches.open("static-cache")).addAll(staticAssets)})),self.addEventListener("fetch",(s=>{const t=s.request;new URL(t.url).origin===location.url?s.respondWith(cacheFirst(t)):s.respondWith(networkFirst(t))}));